export type CartDeliveryTypeItemProps = {
    title: string;
    icon: string;
    isSelected: boolean;
    handleSwitch: () => void
}


export const CartDeliveryTypeItem = (props: CartDeliveryTypeItemProps) => {
    const {title, icon, isSelected, handleSwitch} = props
    return (
        <Card
            // onClick={() => }
            shadow="sm"
            isHoverable
            isPressable
            onPress={() => handleSwitch()}
            className={clsx("flex flex-shrink-0 flex-col justify-center items-center group gap-3 text-sm bg-white hover:bg-primary/20 transition min-w-36 h-36 rounded-xl cursor-pointer text-gray-500 text-center", isSelected ? "bg-primary/20 isSelected" : "")}
        >
            <i dangerouslySetInnerHTML={{__html: icon}}/>
            <span
                className="font-bold transition group-[.isSelected]:text-primary group-hover:text-primary"
            >
                {title}
            </span>
        </Card>
    )
}

